import React, { Component } from "react";
class Count extends Component {
  state = {
    count: 2,
    Tags: [],
  };

  render1() {
    return this.state.Tags.length === 0 ? (
      <h1>nothing to show1</h1>
    ) : (
      this.state.Tags.map((tag) => <li key={tag}>{tag}</li>)
    );
  }
  render2() {
    if (this.state.Tags.length === 0) return <h1>nothing to show2</h1>;
    return this.state.Tags.map((tag) => <li key={tag}>{tag}</li>);
  }
  render3() {
    return this.state.Tags.map((tag) => <li key={tag}>{tag}</li>);
  }

  render() {
    return (
      <React.Fragment>
        {this.state.Tags.length === 0 && "nothing to show3"}
        <ul>{this.render1()}</ul>
        {/* <button className="btn btn-warning">incriment</button> */}
      </React.Fragment>
    );
  }
}

export default Count;
